import React from 'react'
import Navbar from "../../Components/Navbar/Navbar"

function MY_Account() {
  const Box1 = () => {
    return (
      <div style={{ backgroundColor: "#f0f0f0", padding: "20px",  }}>
        <h2>Orders</h2>
        <p>Track, return, or buy things again</p>
      </div>
    );
  };
  
  const Box2 = () => {
    return (
      <div style={{ backgroundColor: "#e0e0e0", padding: "20px",  }}>
        <h2>Login & Secure</h2>
        <p>Edit login, name, and mobile
number</p>
      </div>
    );
  };const Box3 = () => {
    return (
      <div style={{ backgroundColor: "#f0f0f0", padding: "20px",  }}>
        <h2>Address</h2>
        <p>Edit addresses for orders and
gifts</p>
      </div>
    );
  };
  
  const Box4 = () => {
    return (
      <div style={{ backgroundColor: "#e0e0e0", padding: "20px",  }}>
        <h2>Box 2</h2>
        <p>This is the content for Box 2.</p>
      </div>
    );
  };


  return (
    <div>
      <Navbar/>
      <div className='MyAccContainer'>
       <h1>My Account</h1>
       <div>
        <Box1/>
        <hr />
        <Box2/>
        <hr />
        <Box3/>
        <hr />
        <Box4/>
        <hr />
        <Box4/>
        <hr />
        <Box4/>
       </div>

      </div>
    
    </div>
  )
}

export default MY_Account
